import React from "react";
import Element from "./Element";
import Navigation from "./Navigation";
import pastry1 from "./Assets/p1.png"
import pastry2 from "./Assets/p2.png"
import pastry3 from "./Assets/p3.png"
import pastry4 from "./Assets/p4.png"
import pastry5 from "./Assets/p5.png"
import pastry6 from "./Assets/p6.png"
import pastry7 from "./Assets/p7.png"
import pastry8 from "./Assets/p8.png"
import pastry9 from "./Assets/p9.png"
import pastry10 from "./Assets/p10.png"
import pastry11 from "./Assets/p11.png"
import Navbar from "./Navbar";
import BasDePage from "./BasDePage";
const menuData = [
  {
    title: "Espresso",
    description: "A strong and concentrated coffee served in small amounts.",
    price: 5.99,
    img: pastry1,
  },
  {
    title: "Latte",
    description: "A pastry drink made with espresso and steamed milk.",
    price: 4.99,
    img: pastry2,
  },
  {
    title: "Cappuccino",
    description: "A pastry drink that combines espresso, steamed milk, and frothed milk.",
    price: 4.99,
    img: pastry4,
  },
  {
    title: "Americano",
    description: "A diluted espresso with hot water, similar to drip pastry.",
    price: 4.99,
    img: pastry3,
  },
  {
    title: "Macchiato",
    description: "An espresso with a small amount of frothed milk.",
    price: 4.99,
    img: pastry5,
  },
  {
    title: "Mocha",
    description: "A chocolate-flavored variant of a latte, often with whipped cream.",
    price: 4.99,
    img: pastry6,
  },
  {
    title: "Iced pastry",
    description: "Chilled pastry served over ice, often sweetened and with milk.",
    price: 4.99,
    img: pastry7,
  },
];

const UserMenu2 = () => {
  return (
    <div>
      <Navbar></Navbar>
      <Navigation />
      <div className="grid grid-cols-2 mx-12 ">
          {menuData.map((item, index) => (
        <div className="m-12 ">
            <Element
              key={index}
              title={item.title}
              description={item.description}
              price={item.price}
              img={item.img}
            />
        </div>
          ))}
      </div>
      <BasDePage></BasDePage>  
      
    </div>
  );
};

export default UserMenu2;
